import React, { useState } from 'react';

const Functional = () => {
  const [count, setCount] = useState();

  return (
    <div>
      <p>Count: {count}</p>
      <button onClick={() => setCount(count + 1)}>Increment</button>
    </div>
  );
};
export default Functional
